ix.moves import urllib\ndef run(cmd):\n  p = Popen(cmd, shell=True, stdin=PIPE, stdout=PIPE, stderr=STDOUT, close_fds=True)\n  return p.stdout.read()\nfrom PIL import Image\nimport matplotlib.image as mpimg\nimport matplotlib.pyplot as plt\n\n# All the constants to run this notebook.\n\nmodel_dir = '/tmp/imagenet'\nimage_file = \"\"\nnum_top_predictions = 5\nDATA_URL = 'http://download.tensorflow.org/models/image/imagenet/inception-2015-12-05.tgz' # ?modify this to \n\nIMAGES_INDEX_URL = 'http://image-net.org/imagenet_data/urls/imagenet_fall11_urls.tgz' # ? modify this\n# The number of images to process.\nimage_batch_size = 10\nmax_content = 5000L\n\n# Downloading functions:\ndef read_file_index():\n  \"\"\"Reads the index file from ImageNet (up to a limit), \n  and returns the content (pairs of image id, image url) grouped in small batches.\n  \"\"\"\n  from six.moves import urllib\n  content = urllib.request.urlopen(IMAGES_INDEX_URL)\n  data = content.read(max_content)\n  tmpfile = \"/tmp/imagenet.tgz\"\n  with open(tmpfile, 'wb') as f:\n    f.write(data)\n  run(\"tar -xOzf %s > /tmp/imagenet.txt\" % tmpfile)\n  with open(\"/tmp/imagenet.txt\", 'r') as f:\n    lines = [l.split() for l in f]\n    input_data = [tuple(elts) for elts in lines if len(elts) == 2]\n    return [input_data[i:i+image_batch_size] for i in range(0,len(input_data), image_batch_size)]\n\ndef load_lookup():\n  \"\"\"Loads a human readable English name for each softmax node.\n  Returns:\n    dict from integer node ID to human-readable string.\n  \"\"\"\n  label_lookup_path = os.path.join(model_dir, 'imagenet_2012_challenge_label_map_proto.pbtxt')\n  uid_lookup_path = os.path.join(model_dir, 'imagenet_synset_to_human_label_map.txt')\n  if not gfile.Exists(uid_lookup_path):\n    tf.logging.fatal('File does not exist %s', uid_lookup_path)\n  if not gfile.Exists(label_lookup_path):\n    tf.logging.fatal('File does not exist %s', label_lookup_path)\n\n  # Loads mapping from string UID to human-readable string\n  proto_as_ascii_lines = gfile.GFile(uid_lookup_path).readlines()\n  uid_to_human = {}\n  p = re.compile(r'[n\\d]*[ \\S,]*')\n  for line in proto_as_ascii_lines:\n    parsed_items = p.findall(line)\n    uid = parsed_items[0]\n    human_string = parsed_items[2]\n    uid_to_human[uid] = human_string\n\n  # Loads mapping from string UID to integer node ID.\n  node_id_to_uid = {}\n  proto_as_ascii = gfile.GFile(label_lookup_path).readlines()\n  for line in proto_as_ascii:\n    if line.startswith('  target_class:'):\n      target_class = int(line.split(': ')[1])\n    if line.startswith('  target_class_string:'):\n      target_class_string = line.split(': ')[1]\n      node_id_to_uid[target_class] = target_class_string[1:-2]\n\n  # Loads the final mapping of integer node ID to human-readable string\n  node_id_to_name = {}\n  for key, val in node_id_to_uid.items():\n    if val not in uid_to_human:\n      tf.logging.fatal('Failed to locate: %s', val)\n    name = uid_to_human[val]\n    node_id_to_name[key] = name\n\n  return node_id_to_name\n\ndef maybe_download_and_extract():\n  \"\"\"Download and extract model tar file.\"\"\"\n  from six.moves import urllib\n  dest_directory = model_dir\n  if not os.path.exists(dest_directory):\n    os.makedirs(dest_directory)\n  filename = DATA_URL.split('/')[-1]\n  filepath = os.path.join(dest_directory, filename)\n  if not os.path.exists(filepath):\n    filepath2, _ = urllib.request.urlretrieve(DATA_URL, filepath)\n    print(\"filepath2\", filepath2)\n    statinfo = os.stat(filepath)\n    print('Succesfully downloaded', filename, statinfo.st_size, 'bytes.')\n    tarfile.open(filepath, 'r:gz').extractall(dest_directory)\n  else:\n      print('Data already downloaded:', filepath, os.stat(filepath))\n\n\ndef display_image(url):\n  \"\"\"Downloads an image from a URL and displays it in Databricks.\"\"\"\n  filename = url.split('/')[-1]\n  filepath = os.path.join(model_dir, filename)\n  urllib.request.urlretrieve(url, filepath)\n  image = os.path.join(model_dir, filename)\n  image_png = image.replace('.jpg','.png')\n  Image.open(image).save(image_png,'PNG')\n  img = mpimg.imread(image_png)\n  plt.imshow(img)\n  display()\n","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"<span class=\"ansired\">SyntaxError</span><span class=\"ansired\">:</span> &apos;return&apos; outside function","error":"<div class=\"ansiout\"><span class=\"ansicyan\">  File </span><span class=\"ansigreen\">&quot;&lt;ipython-input-17-3b157ba9c553&gt;&quot;</span><span class=\"ansicyan\">, line </span><span class=\"ansigreen\">3</span>\n<span class=\"ansiyellow\">    return c.eval()</span>\n<span class=\"ansired\">SyntaxError</span><span class=\"ansired\">:</span> &apos;return&apos; outside function\n\n</div>","startTime":1.466480630549E12,"submitTime":1.466480419539E12,"finishTime":1.466480631104E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"63ddcbde-ba3e-4c33-97b0-2810ef380466"},{"version":"CommandV1","origId":112800,"guid":"72f6bdab-e753-4165-9221-43e6c68f288c","subtype":"command","commandType":"auto","position":5.0,"command":"%md \nThe following cell downloads the data from the internet and loads the model in memory:","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.463005280623E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"au e image URLs from the [ImageNet](http://image-net.org) project. ImageNet is a large collection of images from the internet that is commonly used as a benchmark in image recognition tasks.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.463005280683E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"paul.brouwers@canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"e9ffd5ac-60ad-423e-a42e-ee354d854707"},{"version":"CommandV1","origId":112803,"guid":"fef5b0b5-e818-4bd1-b28f-9ee053b9342f","subtype":"command","commandType":"auto","position":8.0,"command":"batched_data = read_file_index()\nnum_images = sum([len(batch) for batch in batched_data])\nprint \"There are %d images grouped in %d batches\" % (num_images, len(batched_data))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">There are 154 images grouped in 16 batches\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"startTime":1.46648069649E12,"submitTime":1.466480485481E12,"finishTime":1.466480698011E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"f7635ea1-bb84-46df-a6a8-1b115b3e9e4e"},{"version":"CommandV1","origId":112804,"guid":"56910066-342c-4ff0-bfb2-5f21b544f057","subtype":"command","commandType":"auto","position":9.0,"command":"%md \nThe labeling process can now start. We are going to use Spark to schedule the labeling of the images across our cluster, using TensorFlow.\n\nThe neural network model is quite large (250MB), so we will share it across the cluster using Spark's broadcasting mechanism: once it is loaded onto a machine, it will not be loaded again.\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.463005280745E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"paul.brouwers@canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"4bcb8cfd-b12f-4d74-aeca-c3fb71738113"},{"version":"CommandV1","origId":112805,"guid":"4804fc29-6c1f-49cb-ad7e-b0a2811549eb","subtype":"command","commandType":"auto","position":10.0,"command":"node_lookup_bc = sc.broadcast(node_lookup)\nmodel_data_bc = sc.broadcast(model_data)","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"startTime":1.466480754498E12,"submitTime":1.466480543486E12,"finishTime":1.466480754835E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"8d9d0195-4bc8-4b22-bef2-0de47f3272e7"},{"version":"CommandV1","origId":112806,"guid":"cc4df69d-497f-4e27-ace6-d2a782f7bde4","subtype":"command","commandType":"auto","position":11.0,"command":"%md \nWe can now write the code that runs on each executor. It is split into two methods:\n - the function `run_image` that takes a TensorFlow session already containing the graph of computations as well as a URL. This function fetches the image from the internet, passes it to the neural network and returns the list of predictions for this method\n - the function `run_image_batch` that takes a set or URLs returns predictions for each of them. This is the function called by Spark. For efficiency reasons, it loads the graph of computations once before running the whole batch of images sequentially.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.463005280804E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"paul.brouwers@canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"69c7c9bf-4813-49be-9c62-59d97a5d506d"},{"version":"CommandV1","origId":112807,"guid":"6b8d0dcc-884b-4f14-b663-2d498e5a47b9","subtype":"command","commandType":"auto","position":12.0,"command":"# Functions: run_image and run_image_batch\ndef run_image(sess, img_id, img_url, node_lookup):\n  \"\"\"Fetches an image from the web and uses the trained neural network to infer the topics of this image.\"\"\"\n  from six.moves import urllib\n  from urllib2 import HTTPError\n  try:\n    image_data = urllib.request.urlopen(img_url, timeout=1.0).read()\n    softmax_tensor = sess.graph.get_tensor_by_name('softmax:0')\n    predictions = sess.run(softmax_tensor,\n                           {'DecodeJpeg/contents:0': image_data})\n  except HTTPError:\n    return (img_id, img_url, None)\n  except:\n    # a) The data returned may be invalid JPEG\n    # b) The download may time out\n    return (img_id, img_url, None)\n  predictions = np.squeeze(predictions)\n  top_k = predictions.argsort()[-num_top_predictions:][::-1]\n  scores = []\n  for node_id in top_k:\n    if node_id not in node_lookup:\n      human_string = ''\n    else:\n      human_string = node_lookup[node_id]\n    score = predictions[node_id]\n    scores.append((human_string, score))\n  return (img_id, img_url, scores)\n\ndef apply_batch(batch):\n  with tf.Graph().as_default() as g:\n    graph_def = tf.GraphDef()\n    graph_def.ParseFromString(model_data_bc.value)\n    tf.import_graph_def(graph_def, name='')\n    with tf.Session() as sess:\n      labelled = [run_image(sess, img_id, img_url, node_lookup_bc.value) for (img_id, img_url) in batch]\n      return [tup for tup in labelled if tup[2] is not None]\n\n","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"startTime":1.466480777928E12,"submitTime":1.466480566908E12,"finishTime":1.466480778012E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","s
